body:
### When emailing folder documents from the UC document tab, I want the email subject to be useful, and to copy our workgroup. 

**Stakeholder:** Greg P.

**Acceptance Criteria**
- This applies to the UC folder, document tab (all documents)
- The email subject template should be: {Folder Name} - {Folder Reference #} - ROWID{RSN}
- CC: Aulcc@austintexas.gov, Folder Case Manager {Assigned user on process Permit Case Manager Review (51095)}
